pragma solidity ^0.4.24;

import "./Store.sol";

contract StoreFactory {

    mapping(address => bool) admins;
    mapping(address => bool) storeOwners;
    mapping(address => address[]) stores;

    address[] public allStores;

    //Events
    event LogStoreCreated(address indexed store, address indexed storeOwner);

    constructor() public {
        admins[msg.sender] = true;
    }

    modifier onlyOwner() {
        require(admins[msg.sender] == true);
        _;
    }

    modifier onlyStoreOwner() {
        require(storeOwners[msg.sender] == true);
        _;
    }

    function getUserRole() public view returns (bytes32) {
        address sender = msg.sender;
        if (admins[sender] == true) {
          return "admin";
        }
        if (storeOwners[sender] == true) {
          return "storeOwner";
        }
        return "shopper";
    }

    function addAdmin(address newAdmin) public onlyOwner returns (bool success){
        require(admins[newAdmin] == false);
        admins[newAdmin] = true;
        return true;
    }

    function addStoreOwner(address newStoreOwner) public onlyOwner returns (bool success) {
        if (storeOwners[newStoreOwner] == false) {
            storeOwners[newStoreOwner] = true;
            return true;
        }
        return false;
    }

    function createStore(bytes32 name) public onlyStoreOwner returns (bool) {
        if (name.length != 0) {
          Store store = new Store(msg.sender, name);
          stores[msg.sender].push(store);
          allStores.push(store);
          emit LogStoreCreated(store, msg.sender);
          return true;
        }
        return false;
    }

    function getStores() public view returns (address[] myStores) {
        if (storeOwners[msg.sender] == true) {
            return stores[msg.sender];
        } else {
            return allStores;
        }
    }

}
